export default function gerar_cor(props) {
    if (props.assentos == 0) {
        var r = 255
        var g = 0
        var b = 0
    } else {
        var r = 0
        var g = 0
        var b = 0
    }
        
 
    return `rgb(${r}, ${g}, ${b})`;
 
 }
